import React from "react";
import "../styles/Categories.css";

const Categories = () => {
  return (
    <div>
      <h2>Categories:</h2>
      <div className="categorie--cards">
        <div className="categorie--card">Burgers</div>
        <div className="categorie--card">Pizza </div>
        <div className="categorie--card">Pasta </div>
        <div className="categorie--card">Sushi </div>
        <div className="categorie--card">Salats </div>
        <div className="categorie--card">Soups </div>
        <div className="categorie--card">Burgers</div>
        <div className="categorie--card">Pizza </div>
        <div className="categorie--card">Pasta </div>
        <div className="categorie--card">Sushi </div>
        <div className="categorie--card">Salats </div>
        <div className="categorie--card">Soups </div>
      </div>
    </div>
  );
};

export default Categories;
